    }

    render() {
        return (
            <div className="form-page">
              <Autocomplete
                multiple
                id="tags-outlined"
                options={top100Films}
                getOptionLabel={(option) => option.title}
                filterSelectedOptions
                renderInput={(params) => (
                  <TextField
                    {...params}
                    variant="outlined"
                    label="Opciones"
                  />
                )}
                onChange={(event, val) => this.getOptions(val)}
              />
            </div>
          );
    }
}

export default home;

// Top 100 films as rated by IMDb users. http://www.imdb.com/chart/top
